import React from 'react';

const Card = () => {
    return (

        <div className="container card mt-2 pb-2" style={{borderWidth: '10px', borderColor: 'black'}}>
            <div className="row">
                <div className = "col-xl-9 col-12">
                    <h1 style={{color: 'black'}}>Sorting methods in .NET 8</h1>
                </div>
                <div className = "col-xl-3 col-12 text-xl-end mt-xl-3">
                    <h4 style={{color: 'black'}}>Tuesday, 14 November</h4>
                </div>
                <div className = "col-xl-6 col-12">
                    <img src="https://imagess.hb.ru-msk.vkcs.cloud/maxresdefault.jpg" className="rounded" width="100%" alt="Image"/>
                </div>
                <div className="col-xl-6 col-12 mt-xl-0 mt-2">
                    <h4>In this article, we'll look at the different sorting methods available in the .NET framework. We will study their algorithms, operating principles and performance. You'll also learn how to choose the most appropriate sorting method for your specific task.</h4>
                </div>
            </div>
        </div>
    );
};

export default Card;
